    true,nt"url": null,nt"notes": "The President`s Cyberspace Policy Review
    challenges the Federal community to develop a framework for research and development
    strategies that focus on game-changing technologies that can significantly enhance
    the trustworthiness of cyberspace. The Cybersecurity Game-Change Research and Development
    R and D Recommendations, coordinated through the Federal Networking and Information
    Technology Research and Development NITRD Program www.nitrd.gov and its Cyber Security
    Information Assurance CSIA Interagency Working Group IWG, have identified three
    3 initial R and D themes to exemplify and motivate future Federal cybersecurity
    research activities: a Moving Target, Tailored Trustworthy Spaces, and  Cyber Economic
    Incentives...",nt"license_title": "Other License Specified",nt"extras":
